description:
Experience the tight controls and exhilarating challenge of Starbounder. Harkening back to the golden age of PC shareware titles, Starbounder delivers the kind of intensity that only a true gamer can handle!

Bound through 60 Levels, across 6 different sectors of space.
Stylize your ship with complete customization options unlocked from the start.

Collect all 180 artifacts and unlock the incredible Robo-Panther, for an all new adventure.

